import { useLocation, Navigate, Outlet } from "react-router-dom";
import useAuth from "../hooks/useAuth";

const ProtectRroutes = () => {
    const { auth } = useAuth();
    const location = useLocation();

    return (
        auth.user ? <Navigate to="/login" state={{ from: location }} replace />
               : <Navigate to="/ri" state={{ from: location }} replace />
                // : <Navigate to="/login" state={{ from: location }} replace />
    );
}

export default ProtectRroutes;
